import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Card from '@material-ui/core/Card';
import Adobe from '../../../Assets/Imgs/adobe.jpg'
import Save from '../../../Assets/Imgs/save.svg'
import Discussion from '../../../Assets/Imgs/discussion.svg'
import DownloadIcon from '../../../Assets/Imgs/downloadIcon.svg'
import Calender from '../../../Assets/Imgs/calender.svg'
import CardMedia from '@material-ui/core/CardMedia';

const useStyles = makeStyles({
    root: {
        width: '100%',
        height: '600px',
        borderRadius: 'unset'
    },

    media: {
        height: '100%'
    },

    Main: {
        display: 'flex',
        width: '95%',
        margin: 'auto',
        justifyContent: 'space-between'
    },

    innerDiv: {
        display: 'flex',
     
    },
    contentDiv:{
        display:'flex'
    },

});

export default function BottomPart() {
    const classes = useStyles();

    return (
        <>
            <Card className={classes.root}>

                <CardMedia
                    className={classes.media}
                    image={Adobe}
                    title="image"
                />

            </Card>

            <div className={classes.Main}>
                <div className={classes.innerDiv}>
                    <div className={classes.contentDiv}>
                        <img src = {Save}/>
                        <p>Save note</p>
                    </div>
                    <div className={classes.contentDiv}>
                        <img src = {Discussion}/>
                        <p>Discussion</p>
                    </div>
                    <div className={classes.contentDiv}>
                        <img src = {Calender}/>
                        <p>Add to calendar</p>
                    </div>
                    <div className={classes.contentDiv}>
                        <img src = {DownloadIcon}/>
                        <p>Download</p>
                    </div>
                    
                </div>
                <div className={classes.innerDiv}>
                    
                </div>
            </div>

        </>
    );
}
